import { mockData } from 'shared/api/mockData';

const axios = require('axios');

export class API {

    static handleDataRequestsAPI = request => {    
        let data =  axios.get('https://api.worldtradingdata.com/api/v1/stock?symbol=SPY,DJI,RUS,NDX,TSLA&api_token=UcY7RIsoOUblEZ5NGJ97TS0qjRMdJfE0IyuytK4UtAyRAeGUJkCA127E6wcB').then(response => console.log(response.data))
        console.log(data)
        return data.data;
        // return mockData;
    }

}
